--------------------------------------------------------
--  DDL for View HV_OTH_WORKFLOW_SUMMARY
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "HEIS_SU"."HV_OTH_WORKFLOW_SUMMARY" ("ORG_ID", "SOURCE_SYS_ID", "APPLICATION_NO", "SOURCE_WK_CODE", "SEQNO", "APPLICATION_STAGE", "WORKFLOWSTAGEID", "WORKFLOWID", "ACTUAL_TAT_HOURS", "ACTUAL_TAT_MINS", "ACTUAL_TAT_SECONDS", "MONTH_YEAR", "QUARTER", "STAGE", "STAGE_START_DT", "STAGE_END_DT", "STAGE_STATUS", "STATUS_BUSINESS_DT", "NEW_REQUEST_COUNT", "SYS_LOGIN_COUNT", "SYS_ENTRY_COUNT", "APPROVAL_REQUEST_COUNT", "MAIL_APPROVAL_COUNT", "MAIL_REJECT_COUNT", "APPROVAL_ENTRY_COUNT", "SYS_APPROVAL_COUNT", "SYS_REJECT_COUNT", "HANDOVER_COUNT", "COMPLETED_COUNT", "COMPLETED_TAT", "REQUEST_AMOUNT", "SYS_DECISION_CODE", "FINAL_DECISION_CODE", "DECISION_OWNER_CODE", "REASON_FOR_DECISION", "STAGE_DESC1", "STAGE_DESC2", "STD_TAT_MINS", "WORKFLOW_TYPE", "SLA_TAT", "SLA_REQUEST_SERVICE_COUNT", "ESCALATION_ALERT_MINS", "ACTION_COST", "FIRST_LAST_IND", "GROUP_NAME", "CLIENT_NAME", "CLIENT_CODE", "TYPE_OF_REQUEST", "PRODUCT", "SUBPRODUCT", "STATE", "CITY", "BRANCH", "SOURCE", "CLASSIFICATIONS") AS 
  SELECT HAWO.ORG_ID,
    HAWO.SOURCE_SYS_ID,
    HAWO.APPLICATION_NO,
    HAWO.SOURCE_WK_CODE,
    HAWO.SEQNO,
    HAWO.APPLICATION_STAGE,
    HAWO.WORKFLOWSTAGEID,
    HAWO.WORKFLOWID,
    ACTUAL_TAT_HRS ACTUAL_TAT_HOURS,
    ACTUAL_TAT_MINS ACTUAL_TAT_MINS,
    ACTUAL_TAT_SECONDS ACTUAL_TAT_SECONDS,
    DECODE (HAWO.STAGE_END_DT, NULL, TO_CHAR(HAWO.STAGE_START_DT,'MON-YY'),TO_CHAR(HAWO.STAGE_END_DT,'MON-YY')) Month_Year,
    DECODE (HAWO.STAGE_END_DT, NULL, 'Q'
    ||TO_CHAR(HAWO.STAGE_START_DT,'Q')
    ||'-'
    ||TO_CHAR(HAWO.STAGE_START_DT,'YY'),'Q'
    ||TO_CHAR(HAWO.STAGE_END_DT,'Q')
    ||'-'
    ||TO_CHAR(HAWO.STAGE_END_DT,'YY')) QUARTER,
    (TO_CHAR(UWS.SEQNO,'00')
    ||'.'
    || UWS.STAGE_DESC1) STAGE,
    HAWO.STAGE_START_DT,
    HAWO.STAGE_END_DT,
    HAWO.STAGE_STATUS,
    HAWO.STATUS_BUSINESS_DT,
    (DECODE(SUBSTR(HAWO.APPLICATION_STAGE,2),'INIT_MAIL',1,0))NEW_REQUEST_COUNT,
    (DECODE(SUBSTR(HAWO.APPLICATION_STAGE,2),'SYSDEST',1,0))SYS_LOGIN_COUNT,
    (DECODE(SUBSTR(HAWO.APPLICATION_STAGE,2),'SYSDE',1,0))SYS_ENTRY_COUNT,
    (DECODE(SUBSTR(HAWO.APPLICATION_STAGE,2),'APPR_REQ_MAIL',1,0))APPROVAL_REQUEST_COUNT,
    (DECODE(SUBSTR(HAWO.APPLICATION_STAGE,2),'DECISION_APP_MAIL',1,0)) MAIL_APPROVAL_COUNT,
    (DECODE(SUBSTR(HAWO.APPLICATION_STAGE,2),'DECISION_REJ_MAIL',1,0)) MAIL_REJECT_COUNT,
    (DECODE(SUBSTR(HAWO.APPLICATION_STAGE,2),'DECISION_SYSST',1,0)) APPROVAL_ENTRY_COUNT,
    (DECODE(SUBSTR(HAWO.APPLICATION_STAGE,2),'DECISION_APP_SYS',1,0)) SYS_APPROVAL_COUNT,
    (DECODE(SUBSTR(HAWO.APPLICATION_STAGE,2),'RDECISION_REJ_SYS',1,0)) SYS_REJECT_COUNT,
    (DECODE(SUBSTR(HAWO.APPLICATION_STAGE,2,5),'HOVER',1,0)) HANDOVER_COUNT,
    (DECODE(SUBSTR(HAWO.APPLICATION_STAGE,2,4),'CONF',1,0)) COMPLETED_COUNT,
   (DECODE(SUBSTR(HAWO.APPLICATION_STAGE,2,4),'CONF',CUM_TAT_MINS,0)) COMPLETED_TAT,
    (DECODE(SUBSTR(HAWO.APPLICATION_STAGE,2),'SYSDE',EAI.AMOUNT,0)) /1000 REQUEST_AMOUNT,
    HAWO.SYS_DECISION_CODE,
    HAWO.FINAL_DECISION_CODE,
    HAWO.DECISION_OWNER_CODE,
    HAWO.REASON_FOR_DECISION,
    UWS.STAGE_DESC1,
    UWS.STAGE_DESC2,
    UWS.STD_TAT_MINS,
    UWS.WORKFLOW_TYPE,
    (UWS.STD_TAT_MINS            - ACTUAL_TAT_MINS)         AS SLA_TAT,
    DECODE(SIGN(UWS.STD_TAT_MINS - ACTUAL_TAT_MINS),-1,0,1) AS SLA_REQUEST_SERVICE_COUNT,
    UWS.ESCALATION_ALERT_MINS,
    UWS.ACTION_COST,
    UWS.FIRST_LAST_IND,
    EAI.GROUP_NAME,
    EAI.CLIENT_NAME,
    EAI.Client_Code,
    EAI.TYPE_OF_REQUEST,
    EAI.Product,
    EAI.Subproduct,
    EAI.State,
    EAI.City,
    EAI.Branch,
    EAI.SOURCE,
    (
    case
    
      when (DECODE(SUBSTR(HAWO.APPLICATION_STAGE,2,4),'CONF',CUM_TAT_MINS,0)) between 1 and 29
      then 'Less than 30 Mins'
      when ((DECODE(SUBSTR(HAWO.APPLICATION_STAGE,2,4),'CONF',CUM_TAT_MINS,0)) between 30 and 45)
      then 'Between 30-45 Mins'
      when (DECODE(SUBSTR(HAWO.APPLICATION_STAGE,2,4),'CONF',CUM_TAT_MINS,0)) >45
      then 'More than 45 Mins'
      ELSE 'NA'
    END) AS CLASSIFICATIONS
  FROM HI_APPLICATION_WF_OTH HAWO,
    UM_WORKFLOW_STAGES UWS,
    Email_Attachment_Info EAI
  where HAWO.APPLICATION_STAGE = UWS.APPLSTAGE
  AND HAWO.APPLICATION_NO      =EAI.APPLICATION_ID;
REM INSERTING into HEIS_SU.HV_OTH_WORKFLOW_SUMMARY
SET DEFINE OFF;
